1. To determine the day 686 years ago today, you can use C# to calculate the date by subtracting 686 years from the current date. You can use the DateTime.FromNow and DateTime.Now classes in C# to get the current date and time and then subtract 686 years to get the date 686 years ago.

Here's an example code snippet to calculate the date 686 years ago today:
```csharp
DateTime now = DateTime.Now;
DateTime date686YearsAgo = now.AddYears(-686);
Console.WriteLine(date686YearsAgo.ToString("dddd MMMM yyyy"));
```
This will output the date 686 years ago today in the format "dddd MMMM yyyy".

I hope this helps! Let me know if you have any other questions.

To find the date 1985 years from today, we can use the following formula in MATLAB:
```matlab
current_year = year(now);
year_1985 = current_year - 1985;
```
where `now` is the current date and `year(now)` returns the current year.

So, the MATLAB code to calculate the date 1985 years from today would be:
```matlab
current_year = year(now);
year_1985 = current_year - 1985;
```
Assuming the current date is 2030年1月12日星期六7点11分17秒, the date 1985 years from today will be:
```matlab
current_year = year(now);
year_1985 = current_year - 1985;
disp(year_1985);
```
The output will be:
```
1906
```
So, the date 1985 years from today will be 1906年.
